import React from "react";
import styled from "styled-components";
import EditModal from "./EditModal";

function EditParentsModal({ edit, setEdit, details }) {
  return (
    <Wrapper>
      <Overlay
        onClick={() => {
          setEdit(!edit);
        }}
      />
      <EditModal edit={edit} setEdit={setEdit} details={details} />
    </Wrapper>
  );
}
export default EditParentsModal;

const Wrapper = styled.div`
  width: 100%;
  height: 100%;
  top: 0;
  left: 0;
  position: fixed;
  z-index: 11;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const Overlay = styled.div`
  position: absolute;
  width: 100%;
  height: 100%;
  background-color: rgba(0, 0, 0, 0.65);
`;
